(91, 1, '2021-08-23 07:17:50', '2021-08-23 07:17:50', '<h1>Selamat Datang di Budaya Banyumas</h1>		\n															<img width=\"768\" height=\"432\" src=\"http://localhost/web-banyumas/wp-content/uploads/2021/08/Banyumas-Fit-min.jpg\" alt=\"\" loading=\"lazy\" />															\n			<h2>Banyumas</h2>		\n			<p>Banyumas berasal dari 2 kata: banyu dan mas. Banyu berarti \"air\", mas berarti \"emas\". Nama tersebut diberikan oleh seorang pemuda dari Roma yang mengembara hingga ke wilayah ini. Saat tiba di sini, ia menyaksikan para penduduk sedang mengantri di sebuah sumber mata air karena musim kemarau. Para penduduk mengatakan \"rega banyu kaya mas\" (harga air seperti emas), sehingga muncullah nama tempat ini.</p>		\n			<h3>Ragam Budaya Banyumas</h3>		\n			<figure><img src=\"http://localhost/web-banyumas/wp-content/plugins/elementor/assets/images/placeholder.png\" title=\"\" alt=\"\" /></figure><h4>Kesenian</h4>		\n			<figure><img src=\"http://localhost/web-banyumas/wp-content/plugins/elementor/assets/images/placeholder.png\" title=\"\" alt=\"\" /></figure><h4>Adat dan Tradisi</h4>		\n			<figure><img src=\"http://localhost/web-banyumas/wp-content/plugins/elementor/assets/images/placeholder.png\" title=\"\" alt=\"\" /></figure><h4>Pakaian Adat</h4>		\n			<figure><img src=\"http://localhost/web-banyumas/wp-content/plugins/elementor/assets/images/placeholder.png\" title=\"\" alt=\"\" /></figure><h4>Transportasi Tradisional</h4>		\n			<figure><img src=\"http://localhost/web-banyumas/wp-content/plugins/elementor/assets/images/placeholder.png\" title=\"\" alt=\"\" /></figure><h4>Rumah Adat</h4>		\n			<figure><img src=\"http://localhost/web-banyumas/wp-content/plugins/elementor/assets/images/placeholder.png\" title=\"\" alt=\"\" /></figure><h4>Permainan Anak</h4>		\n			<figure><img src=\"http://localhost/web-banyumas/wp-content/plugins/elementor/assets/images/placeholder.png\" title=\"\" alt=\"\" /></figure><h4>Tokoh dan Seniman</h4>		\n			<figure><img src=\"http://localhost