(142, 1, '2021-08-23 12:48:02', '2021-08-23 12:48:02', '<h1>Selamat Datang di Budaya Banyumas</h1>		\n			<a href=\"#profile\" role=\"button\">\n						Selengkapnya\n					</a>\n															<img width=\"768\" height=\"432\" src=\"http://localhost/web-banyumas/wp-content/uploads/2021/08/Banyumas-Fit-min.jpg\" alt=\"\" loading=\"lazy\" />															\n			<h2>Banyumas</h2>		\n			<p>Banyumas berasal dari 2 kata: banyu dan mas. Banyu berarti \"air\", mas berarti \"emas\". Nama tersebut diberikan oleh seorang pemuda dari Roma yang mengembara hingga ke wilayah ini. Saat tiba di sini, ia menyaksikan para penduduk sedang mengantri di sebuah sumber mata air karena musim kemarau. Para penduduk mengatakan \"rega banyu kaya mas\" (harga air seperti emas), sehingga muncullah nama tempat ini.</p>		\n			<h3>Ragam Budaya Banyumas</h3>		\n			<figure><a href=\"http://localhost/web-banyumas/category/kesenian/\"><img src=\"http://localhost/web-banyumas/wp-content/plugins/elementor/assets/images/placeholder.png\" title=\"\" alt=\"\" /></a></figure><h4><a href=\"http://localhost/web-banyumas/category/kesenian/\">Kesenian</a></h4>		\n			<figure><a href=\"http://localhost/web-banyumas/category/adat-dan-tradisi/\"><img src=\"http://localhost/web-banyumas/wp-content/plugins/elementor/assets/images/placeholder.png\" title=\"\" alt=\"\" /></a></figure><h4><a href=\"http://localhost/web-banyumas/category/adat-dan-tradisi/\">Adat dan Tradisi</a></h4>		\n			<figure><a href=\"http://localhost/web-banyumas/category/pakaian-adat/\"><img src=\"http://localhost/web-banyumas/wp-content/plugins/elementor/assets/images/placeholder.png\" title=\"\" alt=\"\" /></a></figure><h4><a href=\"http://localhost/web-banyumas/category/pakaian-adat/\">Pakaian Adat</a></h4>		\n			<figure><a href=\"http://localhost/web-banyumas/category/transportasi-tradisional/\"><img src=\"http://localhost/web-banyumas/wp-content/plugins/elementor/assets/images/placeholder.png\" title=\"\" alt=\"\" /></a></figure><h4><a href=\"http